import styled from 'styled-components';
const AuthTemplateBlock = styled.div`
  position: absolute;
  left: 0;
  top: 0;
  botton: 0;
  right: 0;
`;

const AuthTemplate = ({ children }) => {
  return <AuthTemplateBlock>{children}</AuthTemplateBlock>;
};

export default AuthTemplate;
